import React from 'react';
import Loader from 'react-loader-spinner'
import "react-loader-spinner/dist/loader/css/react-spinner-loader.css"

const Loading = () => {
    return(
        <div className="col-12 text-center">
            <Loader
                type="audio-loading"
                color="orange"
                height={100}
                width={100}
                timeout={3000}
            />
        </div>
    );
}

export default Loading;
